function CategorySection({ setCategory, setProductList }) {
  const [isTechCategories, setIsTechCategories] = useState(true);

  const handleCategoryChange = (category) => {
    setCategory(category);
    setProductList(products[category]); // Set the products based on category selected
  };

  return (
    <div>
      <div>
        <button onClick={() => setIsTechCategories(!isTechCategories)} className="section">
          {isTechCategories ? "Click to See Fashion/Accessories/Home" : "Click to See Tech products"}
        </button>
      </div>
      <div className="category-list">
        {(isTechCategories ? techCategories : fashionCategories).map((category) => (
          <button
            key={category}
            onClick={() => handleCategoryChange(category)}
            className="category-button"
          >
            {category}
          </button>
        ))}
      </div>
    </div>
  );
}

export default CategorySection;
